import { Link } from "react-router-dom";
import Login from "./Login";

const Navbar = ({isLoggedIn}) => {
    return (
        <div>
            {isLoggedIn ? ( 
                <nav>
                    <div>
                        <Link to="/">Home</Link>
                    </div>
                </nav>
             ) : (
                <nav>
                    <div>
                        <Link to="/">Home</Link>
                    </div>
                    <div>
                        <Link to="login">Login</Link>
                    </div>
                </nav>
            )}
        </div>
    )
}
export default Navbar
